    frequency = {}
    for num in nums:
        if num not in frequency:
            frequency[num] += 1
        else:
            frequency[num] = 1
    sorted_list = []
    for (key, value) in frequency.items():
        sorted_list.append((key, value))
    sorted_list.sort(reverse=True, key=lambda x: x[0])
